import unittest

class Solution(object):
  def isSubsequence(self, s, t):
    """
    :type s: str
    :type t: str
    :rtype: bool
    """
    i = 0
    j = 0
    while j < len(t):
      if i < len(s) and s[i] == t[j]:
        i += 1
      j += 1
    return i == len(s)

class TestIsSubsequenceFunction(unittest.TestCase):
  def setUp(self):
    self.solution = Solution()

  def test_case1(self):
    s = "abc"
    t = "ahbgdc"
    output = True
    result = self.solution.isSubsequence(s,t)
    self.assertEqual(output, result)

  def test_case2(self):
    s = "axc"
    t = "ahbgdc"
    output = False
    result = self.solution.isSubsequence(s,t)
    self.assertEqual(output, result)

  def test_case3(self):
    s = "leeeeetcode"
    t = ""
    output = True
    result = self.solution.isSubsequence(s,t)
    self.assertEqual(output,result)

if __name__ == '__main__':
  unittest.main()